import Foundation
import QuartzCore

var maxMismatches:Int = 1
var mismatches:Int = 0

var sourceString:String = "";

var patternToSearch:String = "CATGGTT"

//var sourceString:String = "AAATCGACCTTAGAACGGCCA"
//var patternToSearch:String = "CGACC"

var currMatch:String = ""

let start: TimeInterval = CACurrentMediaTime()

for i in 0...(sourceString.characters.count - patternToSearch.characters.count){

  currMatch = ""
  mismatches = 0

  var k:Int = 0
  for j in i...(i + patternToSearch.characters.count - 1){

    currMatch = currMatch + String(sourceString[sourceString.index(sourceString.startIndex, offsetBy:j)])

    if(!(sourceString[sourceString.index(sourceString.startIndex, offsetBy:j)] == patternToSearch[patternToSearch.index(patternToSearch.startIndex, offsetBy:k)])){
      mismatches = mismatches + 1
    }

    k = k + 1
  }

  if(mismatches <= maxMismatches){
    do {
      try currMatch.write(toFile:"patterns.txt", atomically: false, encoding: String.Encoding.utf8)
    } catch let error as NSError {
    }
  }
}

print("\(CACurrentMediaTime() - start)")
